import ExpanseItem from "./components/ExpanseItem";
function App() {
  const expans = [
    {
      title: "Car Insurance !",
      amount: "250",
      date: new Date(2021, 3, 20),
    },
    {
      title: "Work Insurance !",
      amount: "280",
      date: new Date(2021, 2, 18),
    },
    {
      title: "Music Insurance !",
      amount: "400",
      date: new Date(2021, 9, 20),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <h1>Hello Paper</h1>
      <ExpanseItem
        title={expans[0].title}
        date={expans[0].date}
        amount={expans[0].amount}
      ></ExpanseItem>
    </div>
  );
}

export default App;
